import { countingValleys } from '../../src/hackerrank/counting-valleys';

describe("Sock Merchant", () => {
  it('should return the count of valleys', () => {
    const numberOfSteps = 8;
    const pathDescription = 'UDDDUDUU';
    const expectedResult = 1;
    expect(countingValleys(numberOfSteps, pathDescription)).toEqual(expectedResult);
  });

  it('should return the count of valleys', () => {
    const numberOfSteps = 1000000;
    const pathDescription = '';
    const expectedResult = 718;
    expect(countingValleys(numberOfSteps, pathDescription)).toEqual(expectedResult);
  });
});
